/* -------------------------------------------------- */
/* LOCKED AND LOADED
/* -------------------------------------------------- */

function onLoad(loading, loaded) {
	"use strict";
	
	if ( document.readyState === "complete" ) {
		
		return loaded();
		
	}
	
	loading();

	if ( window.addEventListener ) {
		
		window.addEventListener("load", loaded, false);
		
	} else if ( window.attachEvent ) {
		
		window.attachEvent("onload", loaded);
		
	}
}
